const ItemList = (props) => {
  const { item1 } = props;
  // Nhan props
  // destructuring
  console.log(item1);

  const items = ["Item 1", "Item 2", "Item 3", "Item 4", "Item 4", "Item 4"];

  return (
    <ul className="item-list">
      {items.map((item, index) => {
        return <li key={index}>{item}</li>;
      })}
    </ul>
  );
};

export default ItemList;
